import React from "react";
import "./Navigation.css";
import { Link } from "react-router-dom";
function Navigation() {
  return (
    <nav className="navbar navbar-dark bg-dark">
      <ul>
        <Link to="/">
          <li>Home</li>
        </Link>
        <a href="#Top Heading">
          {" "}
          <li>Top Headlines</li>{" "}
        </a>
        <a href="#Business">
          {" "}
          <li>Business</li>
        </a>
        <a href="#Entertainment">
          {" "}
          <li>Entertainment</li>
        </a>
        <a href="#Health">
          {" "}
          <li>Health</li>
        </a>
        <a href="#Technology">
          {" "}
          <li>Technology</li>
        </a>
        <a href="#Sports">
          {" "}
          <li>Sports</li>
        </a>
        <a href="#Science">
          {" "}
          <li>Science</li>
        </a>
      </ul>
    </nav>
  );
}

export default Navigation;
